import React, { Component } from "react";
import "./Die.styles.scss";

class Die extends Component {
  handleClick = () => {
    this.props.handleClick(this.props.idx);
  };
  render() {
    return (
      <button
        className={"Die"}
        style={{ backgroundColor: this.props.locked ? "grey" : "black" }}
        onClick={this.handleClick}
      >
        {this.props.val}
      </button>
    );
  }
}

export default Die;
